import * as React from "react";
import {
  AppBar,
  Box,
  Toolbar,
  Typography,
  Container,
  Link,
} from "@mui/material";
import { makeStyles } from "@mui/styles";
import "../styles/Header.css";

const Header = () => {
  const pages = ["Home", "About", "Projects", "Resume"];

  return (
    <AppBar position="static">
      <Container maxWidth="xl">
        <Toolbar disableGutters>
          <Box className={linksContainer}>
            {pages.map((page) => (
              <Box className={linkContainer}>
                <Link
                  href={page}
                  key={page}
                  underline="hover"
                  className={link}
                >
                  {page}
                </Link>
              </Box>
            ))}
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
  );
};
export default Header;
